window.bookSummaryJSON = "<p><b>Rescue never looked so dangerous.</b></p> <p>Lucky and crew think the worst is behind them when a ship finally arrives to whisk them away from a doomed diplomatic mission. </p> <p>It doesn't take long to learn how wrong they are.</p> <p>Before they know it, a seemingly vanquished foe returns more powerful, and with more resources, than ever. </p> <p>But it's the source of this new power that proves more disturbing than anything else. </p> <p>As time runs out, and the stakes rise to inconceivable levels, Lucky realizes that even if he wins, everybody loses. </p> <p>Don't ask Lucky. Just give him a weapon and get out of the way. </p> <p><i>Gritty. Fast-Paced. Addictive. You'll love this high-octane military sci-fi because it's the love child of \"Starship Troopers\" and \"Jason Bourne.\"</i></p> <p><b>Feeling Lucky? Buy Lucky's Marines Part 3 today and experience the epic series finale!</b></p> <p>Books included in this Publisher's Pack:</p> <p><i>Lucky Bastard</i></p> <p><i>Lucky At Last</i></p>"; 
